import React from "react";
import Button from "./Button"
import portail from "../images/lauraPic.jpeg"

export default function Card() {
    return (
        <>
            <img src={ portail } alt="Laura's pic" className="image" />
            <h1 className="title">Laura Smith</h1>
            <h2 className="position">Frontend Developer</h2>
            <p className="web-address">Laurasmith.website</p>
            <Button />
        </>
    )
}
